Aplicația România Sălbatică își propune să te țină permanent conectat la natură și să te ajute să înțelegi mai bine importanța biodiversității din țara noastră.

Cu ajutorul aplicației poți să: 
- Descoperi natura României structurată pe regiuni: Munții Carpați, pădurile virgine, Dunărea și Delta, Marea Neagră sau regiuni biogeografice;
- Urmărești calendarul naturii, unde o să regăsești cele mai interesante evenimente naturale, cum ar fi: rotitul cocoșului de munte, migrația de primăvară sau toamnă, perioadele de înflorire ale anumitor specii de flori, boncănitul cerbului și multe altele;
- Creezi un cont în care să îți salvezi liste cu zone pe care vrei să le vezi și unde poți adăuga evenimentele naturale în calendarul personal;
- Înveți despre parcurile naționale și naturale ale României, dar și despre alte arii naturale protejate;
- Urmezi sfaturile și recomandări noastre despre zone și trasee;
- Admiri fotografii spectaculoase cu peisaje, faună sau floră, realizate de membrii Forona (Organizația Fotografilor de Natură din România).

Cu ajutorul aplicației noastre natura României nu a fost niciodată mai accesibilă și mai ușor de înțeles.

